                    "text": "If multiple players each control an Unholy Indenture attached to one creature, the player who will control the returned creature is the last player in turn order from the player whose turn it is at the time the creature dies. In a two-player game, this means the player whose turn it is not. In a multiplayer game, this means the player closest to the right of the player whose turn it is."
