                    "text": "In some cases involving linked abilities, an ability requires information about â€œthe exiled card.â€ When this happens, the ability gets multiple answers. If these answers are being used to determine the value of a variable, the sum is used. For example, if Elite Arcanistâ€™s enters-the-battlefield ability triggers twice, two cards are exiled. The value of X in the activation cost of Elite Arcanistâ€™s other ability is the sum of the two cardsâ€™ converted mana costs. As the ability resolves, you create copies of both cards and can cast none, one, or both of the copies in any order."
